import React from 'react';

import AddBoard from 'components/AddBoard/AddBoard';
import { CloseModalCross } from '../../mainModal/CloseModal';
import {
  ModalContainer,
  ModalTitle,
  ModalHeader,
  Div,
} from '../EditProfileModal/EditProfileModal.styled';

const AddBoardModal = () => {
  const [isModalOpen, setIsModalOpen] = React.useState(false);

  const openModal = () => {
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };
  const handleClickBackdrop = () => {
    closeModal();
  };

  const handleCloseModal = () => {
    closeModal();
  };

  return (
    <Div onClick={handleClickBackdrop}>
      <ModalContainer onClick={handleClickBackdrop}>
        <ModalHeader>
          <ModalTitle>New board</ModalTitle>
          <CloseModalCross onClick={handleCloseModal} />
        </ModalHeader>
        <AddBoard />
      </ModalContainer>
    </Div>
  );
};

export default AddBoardModal;
